import React from "react";

function Header(props) {
    return <div className="jumbotron jumbotron-fluid text-center">
      <h1 className="display-4">Good Boy Memory Click</h1>
      <p className="lead">Try to click each good boy only once!</p>
      <div className="row">

      <div className="col-md-6"><h2>Score: {props.score} </h2></div>
      <div className="col-md-6"><h2>HighScore: {props.highScore}</h2> </div>
      </div>

  </div>
}

export default Header;
